import React, {useState} from 'react';
import './Home.css';
import {useNavigate} from 'react-router-dom';

function Home(){ 
    const navigate = useNavigate();
    const [mbti, changeColor]= [
      ["E","I"],
      ["S","N"],
      ["T","F"],
      ["J","P"]
    ];
    const mean = ["에너지 방향","인식 방식", "판단", "생활 양식"];

    return (
      <div className="Home">
        <div className="upperTitle">
          <p>MBTI</p>
          <button onClick={()=>navigate('/admin')}>
            관리자 페이지</button>
        </div>

        <div className="chooseMbti">
          {mbti.map((a,i)=>{
               <div>
                 <input onClick={()=>{
                   changeColor()
                 }}className={i} 
                 type="radio" 
                 value={a[0]}/>

                 <p className={i}>mean[i]</p>

                 <input onClick={()=>{
                  changeColor()
                 }} className={i} 
                 type="radio" 
                 value={a[1]}/>
                 <label for={i}>i</label>
               </div>
            })}

           <div className="completeBtn">
              <input type='submit' value={"확인"} onClick={()=>{navigate('/result');}}/>
           </div>
        </div>

        <div className="lowerTitle"></div>
      </div>
    );
};

export default Home;
